from collections import defaultdict

def fill_dict_with_singletons(str):
    substrings = defaultdict(list)
    for i, char in enumerate(str):
        substrings[char].append((i, i + 1))
    return substrings

def remove_without_duplicates(substrings):
    new_substrings = defaultdict(list)
    for substr, indices in substrings.items():
        if len(indices) >= 2:
            new_substrings[substr] = indices
    return new_substrings

def get_some_key(a_dict):
    if a_dict:
        return list(a_dict)[0]

class NaiveSolution:
    def longestDupSubstring(self, S: str) -> str:
        self.S = S
        curr_longest = ""
        substrings = fill_dict_with_singletons(S)
        substrings = remove_without_duplicates(substrings)

        while substrings:
            curr_longest = get_some_key(substrings)
            substrings = self.grow(substrings)
            substrings = remove_without_duplicates(substrings)
        
        return curr_longest

    def grow(self, substrings):
        S_len = len(self.S)
        new_substrings = defaultdict(list)
        indices = [pair for p_list in substrings.values() for pair in p_list]
        new_indices = [(a, b + 1) for a, b in indices if b < S_len]

        for a, b in new_indices:
            new_substr = self.S[a:b]
            new_substrings[new_substr].append((a, b))

        return new_substrings



# mystr = "banana"
